sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils=new PatientUtilsPractice();
    var patient=utils.patientDetails(inputs.patient_id);
    outputs.first_name=patient.u_first_name;
    outputs.last_name=patient.u_last_name;
    outputs.pid=patient.sys_id;
})(inputs, outputs);

